INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 9, 1, 3001, 1, 5, 2.46, 2, "vo_minigame_1012_result_1082", 12300150, 3, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 9, 1, 3001, 1, 5, 2.94, 2, "vo_minigame_1012_result_1083", 12300151, 3, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 9, 1, 3001, 1, 5, 4.19, 2, "vo_minigame_1012_result_1084", 12300152, 7, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 9, 1, 3001, 1, 5, 0.0, 2, "vo_minigame_1012_result_1085", 12300153, 1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 9, 1, 3001, 1, 5, 2.63, 2, "vo_minigame_1012_result_1086", 12300154, 3, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 4, 1, 3001, 1, 1, 5.53, 2, "vo_minigame_1012_result_1087", 12300155, 3, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 4, 1, 3001, 3, 1, 0.01, 2, "vo_minigame_1012_result_1088", 12300156, 3, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1);
