INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 4, 1, 3001, 9, 1, 0.01, 2, "vo_minigame_1012_result_1090", 12300158, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 4, 1, 3001, 1, 1, 5.37, 2, "vo_minigame_1012_result_1091", 12300159, 3, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 4, 1, 3001, 1, 1, 1.44, 2, "vo_minigame_1012_result_1092", 12300160, 3, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 2);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 4, 1, 3001, 3, 1, 0.0, 2, "vo_minigame_1012_result_1093", 12300161, 3, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3);
