INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (0, 4, 1, 3001, 1, 1, 2.61, 2, "vo_minigame_1012_result_1095", 12300163, 5, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 3);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 1, 3001, 2, 0, 3.63, 2, "vo_minigame_1012_result_1096", 12300164, 4, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 1);
